import React from "react";
import "./Frame1945.css";

function Frame1945(props) {
  const { group, vector, vector2, vector3, vector4, vector5, text28 } = props;

  return (
    <div className="frame-19452">
      <div className="frame-35962">
        <div className="frame2">
          <div className="group" style={{ backgroundImage: `url(${group})` }}></div>
          <img className="vector2" src={vector} />
          <img className="vector-13" src={vector2} />
          <img className="vector-22" src={vector3} />
          <img className="vector-32" src={vector4} />
          <img className="vector-42" src={vector5} />
        </div>
        <div className="text-28 ibmplexsans-semi-bold-quarter-spanish-white-16px">{text28}</div>
      </div>
      <div className="rectangle-8593"></div>
    </div>
  );
}

export default Frame1945;
